import NavbarComponent from "./components/Navbar";
import Footer from "./components/Footer";

import "./styles/main.scss";

function App() {
  return (
    <div>
      <NavbarComponent />
      <SimpleSlider />
      <LatestNews />
      <LatestMovies />
      <Footer/>
    </div>
  );
}

export default App;
